        [TestMethod]
        public void ArrivalAndShiftForExistingVoyage()
        {
            MTNInitialize();

            FormObjectBase.NavigationMenuSelection(@"EDI Functions|EDI Operations");

            EDIOperationsForm ediOperationsForm = new EDIOperationsForm(@"EDI Operations POB");

            /*// Thursday, 20 March 2025 navmh5 Can be removed 6 months after specified date 
            ediOperationsForm.DeleteEDIMessages(@"Voyage", @"62007", @"Loaded");
            ediOperationsForm.LoadEDIMessageFromFile(ediFile1);
            ediOperationsForm.ChangeEDIStatus(ediFile1, @"Loaded", @"Verify");
            ediOperationsForm.ChangeEDIStatus(ediFile1, @"Verified", @"Load To DB");*/
            ediOperationsForm.DeleteLoadChangeStatus(
                new DeleteFileArgs { FileNameToSearch = "62007", EDIStatus = EDIOperationsStatusType.Loaded, EDIFileType = EDIOperationsDataType.Voyage },
                new LoadFileArgs { FileToLoad = ediFile1 },
                new []
                {
                    new ChangeStatusFromToArgs
                        { FromStatus = EDIOperationsStatusType.Loaded, ToStatus = "Verify" },
                    new ChangeStatusFromToArgs
                        { FromStatus = EDIOperationsStatusType.Verified, ToStatus = "Load To DB" },
                });

            // Check Voyage and voyage movements are created as expected
            FormObjectBase.NavigationMenuSelection(@"Voyage Functions|Admin|Voyage Enquiry");
            voyageEnquiryForm = new VoyageEnquiryForm(@"Voyage Enquiry POB");

            voyageEnquiryForm.FindVoyageByVoyageCode(@"192708");
            // MTNControlBase.FindClickRowInTable(voyageEnquiryForm.tblVoyages, @"Code^192708", ClickType.DoubleClick);
            voyageEnquiryForm.TblVoyages.FindClickRow(["Code^192708"], ClickType.DoubleClick);

            voyageDefinitionForm = new VoyageDefinitionForm(@"PHILIPPOS - (192708) Voyage Definition POB");
            voyageDefinitionForm.MovementsDelaysTab();
            voyageDefinitionForm.TblMovements.FindClickRow(new[] { $"Type^Arrival~Day^MON~Occurs on Date/Time^04/12/2023 11:30~From Berth^~To Berth^Berth 3 - Fisherman Island (114)" });
            voyageDefinitionForm.TblMovements.FindClickRow(new[] { $"Type^Shift~Day^TUE~Occurs on Date/Time^05/12/2023 10:00~From Berth^Berth 3 - Fisherman Island (114)~To Berth^Brisbane International Cruise Terminal" });
            voyageDefinitionForm.TblMovements.FindClickRow(new[] { $"Type^Departure~Day^WED~Occurs on Date/Time^06/12/2023 21:00~From Berth^Brisbane International Cruise Terminal~To Berth^" });

            ediOperationsForm.SetFocusToForm();
            ediOperationsForm.LoadEDIMessageFromFile(ediFile2);
            ediOperationsForm.ChangeEDIStatus(ediFile2, @"Loaded", @"Verify");
            ediOperationsForm.ChangeEDIStatus(ediFile2, @"Verified", @"Load To DB");

            // Check Voyage and voyage movements are updated
            voyageDefinitionForm.SetFocusToForm();
            voyageDefinitionForm.MovementsDelaysTab();
            voyageDefinitionForm.TblMovements.FindClickRow(new[] { $"Type^Arrival~Day^WED~Occurs on Date/Time^06/12/2023 11:30~From Berth^~To Berth^Berth 3 - Fisherman Island (114)" });
            voyageDefinitionForm.TblMovements.FindClickRow(new[] { $"Type^Shift~Day^THU~Occurs on Date/Time^07/12/2023 10:00~From Berth^Berth 3 - Fisherman Island (114)~To Berth^Brisbane International Cruise Terminal" });
            voyageDefinitionForm.TblMovements.FindClickRow(new[] { $"Type^Departure~Day^FRI~Occurs on Date/Time^08/12/2023 10:00~From Berth^Brisbane International Cruise Terminal~To Berth^" });

            // Check Port of Brisbane is added to the Port of Calls automatically
            voyageDefinitionForm.PortsOfCallandOperators();
            string[] selectedPorts =
           {
               // Selected Ports list

               "SIN (SG) Singapore",
               "SIN (SG) Singapore",
               "BNE (AU) Brisbane"
            };
            voyageDefinitionForm.CheckSelectedPort(selectedPorts);
        }
